title_definition['11422'] = {id = 11422, note = "^f95db9《Quân Tấm Tự Ngã》",desc = " ngã trụ trường giang đầu, quân trụ trường giang vĩ. \r Nhật nhật tư quân bất kiến quân, cộng ẩm trường giang thủy. \r Thử thủy kỷ thì hưu, thử hận hà thì dĩ. \r Chỉ nguyện quân tấm tự ngã tấm, định bất phụ tương tư ý."}
